webpackJsonp([64433502925779],{2804:function(e,i){e.exports={pathContext:{docHtml:'<h2>Unreleased</h2>\n<ul>\n<li>Fixes stringify to only take ancestors into account when checking\ncircularity.<br>\nIt previously assumed every visited object was circular which led to <a href="https://github.com/isaacs/json-stringify-safe/issues/9">false\npositives</a>.<br>\nUses the tiny serializer I wrote for <a href="https://github.com/moll/js-must">Must.js</a> a year and a half ago.</li>\n<li>Fixes calling the <code>replacer</code> function in the proper context (<code>thisArg</code>).</li>\n<li>Fixes calling the <code>cycleReplacer</code> function in the proper context (<code>thisArg</code>).</li>\n<li>Speeds serializing by a factor of\nBig-O(h-my-god-it-linearly-searched-every-object) it had ever seen. Searching\nonly the ancestors for a circular references speeds up things considerably.</li>\n</ul>',docPath:"argo-ci/node_modules/json-stringify-safe/changelog",proj:"argo-ci"}}}});
